        "id": 4384,
        "name": "DreamShaper",
        "description": "<h1 id=\"heading-133\">DreamShaper - V∞!</h1><h3 id=\"heading-134\">Please check out my other <a target=\"_blank\" rel=\"ugc\" href=\"https://civitai.com/user/Lykon/models?tag=base+model\">base models</a>, including <u>SDXL</u> ones!</h3><p><strong>Check the version description below (bottom right) for more info and add a ❤️ to receive future updates.</strong><br /><strong>Do you like what I do? Consider supporting me on </strong><a target=\"_blank\" rel=\"ugc\" href=\"https://www.patreon.com/Lykon275\"><strong>Patreon</strong></a><strong> 🅿️ to get exclusive tips and tutorials, or feel free to </strong><a target=\"_blank\" rel=\"ugc\" href=\"https://snipfeed.co/lykon\"><strong>buy me a coffee</strong></a><strong> ☕</strong><br />🎟️ <a target=\"_blank\" rel=\"ugc\" href=\"https://ko-fi.com/lykon/commissions\"><strong>Commissions on Ko-Fi</strong></a></p><p></p><h3 id=\"heading-135\">Join my <a target=\"_blank\" rel=\"ugc\" href=\"https://discord.gg/uAhsmDq7GC\">Discord Server</a></h3><p><strong><span style=\"color:rgb(253, 126, 20)\">For LCM read the version description.</span></strong></p><p></p><p><strong>Available on the following websites with GPU acceleration:</strong></p><ul><li><p><a target=\"_blank\" rel=\"ugc\" href=\"https://www.mage.space/\"><strong>Mage.space</strong></a></p></li><li><p><a target=\"_blank\" rel=\"ugc\" href=\"https://sinkin.ai/m/4zdwGOB\"><strong>Sinkin.ai</strong></a></p></li><li><p><a target=\"_blank\" rel=\"ugc\" href=\"https://randomseed.co/model/20?via=lykon\"><strong>RandomSeed</strong></a></p></li><li><p><a target=\"_blank\" rel=\"ugc\" href=\"http://AnimeMaker.ai\"><strong>AnimeMaker.ai</strong></a></p></li><li><p><a target=\"_blank\" rel=\"ugc\" href=\"https://rendernet.ai/creator/Lykon\"><strong>Rendernet.ai</strong></a></p></li><li><p><a target=\"_blank\" rel=\"ugc\" href=\"https://tensor.art/u/600303455797521413\">https://tensor.art/u/600303455797521413</a></p></li></ul><p><br /><a target=\"_blank\" rel=\"ugc\" href=\"https://huggingface.co/spaces/Lykon/DreamShaper-webui\"><strong>Live demo available on HuggingFace</strong></a><strong> (CPU is slow but free).</strong></p><p><strong>New Negative Embedding for this: </strong><a target=\"_blank\" rel=\"ugc\" href=\"https://civitai.com/models/72437?modelVersionId=77169\"><strong>Bad Dream</strong></a><strong>.</strong><br /></p><h2 id=\"heading-210\"><strong>Message from the author</strong></h2><p>Hello hello, my fellow <strong>AI Art</strong> lovers. Version 8 just released. Did you like the cover with the ∞ symbol? This version holds a special meaning for me.<br /><br />DreamShaper started as a model to have an alternative to MidJourney in the open source world. I didn't like how MJ was handled back when I started and how closed it was and still is, as well as the lack of freedom it gives to users compared to SD. Look at all the tools we have now from TIs to LoRA, from ControlNet to Latent Couple. We can do anything. The purpose of DreamShaper has always been to make \"a better Stable Diffusion\", a model capable of doing everything on its own, to <em>weave dreams</em>. <br />With SDXL (and, of course, <strong>DreamShaper XL</strong> 😉) just released, I think the \"<em>swiss knife</em>\" type of model is closer then ever. That model architecture is big and heavy enough to accomplish that the pretty easily. But what about all the resources built on top of SD1.5? Or all the users that don't have 10GB of vram? It might just be a bit too early to let go of DreamShaper. <br /><br />Not before one. Last. Push. <br /><br />And here it is, I hope you enjoy. And thank you for all the support you've given me in the recent months.</p><p><strong>PS: </strong>the primary goal is still towards art and illustrations. Being good at everything comes second.</p><p><br /><strong>Suggested settings:</strong><br />- I had CLIP skip 2 on some pics, the model works with that too. <br />- I have <em>ENSD</em> set to 31337, in case you need to reproduce some results, but it doesn't guarantee it. <br />- All of them had <strong>highres.fix</strong> or img2img at higher resolution. Some even have ADetailer. Careful with that tho, as <strong><span style=\"color:rgb(250, 82, 82)\">it tends to make all faces look the same</span>.</strong><br />- I <strong>don't use \"restore faces\"</strong>.</p><p><strong>For old versions:</strong><br />- Versions &gt;4 require no LoRA for anime style. For version 3 I suggest to use one of these LoRA networks at 0.35 weight: <br />-- <a target=\"_blank\" rel=\"ugc\" href=\"https://civitai.com/models/4219\">https://civitai.com/models/4219</a> (the girls with glasses or if it says <code>wanostyle</code>)<br />-- <a target=\"_blank\" rel=\"ugc\" href=\"https://huggingface.co/closertodeath/dpepmkmp/blob/main/last.pt\">https://huggingface.co/closertodeath/dpepmkmp/blob/main/last.pt</a> (if it says <code>mksk style</code>)<br />-- <a target=\"_blank\" rel=\"ugc\" href=\"https://civitai.com/models/4982/anime-screencap-style-lora\">https://civitai.com/models/4982/anime-screencap-style-lora</a> (not used for any example but works great).</p><h3 id=\"heading-252\"><strong>LCM</strong></h3><p>Being a distilled model it has lower quality compared to the base one. However it's MUCH faster and perfect for video and real time applications.</p><p>Use it with 5-15 steps, ~2 cfg. <strong><u><span style=\"color:rgb(253, 126, 20)\">IT WORKS ONLY WITH LCM SAMPLER</span></u></strong> (as of December 2023, Auto1111 requires an external plugin for it).</p><p>Comparison with V7 LCM <a target=\"_blank\" rel=\"ugc\" href=\"https://civitai.com/posts/951513\">https://civitai.com/posts/951513</a><br /><br /><strong>NOTES</strong></p><ul><li><p>Version 8 focuses on improving what V7 started. Might be harder to do photorealism compared to realism focused models, as it might be hard to do anime compared to anime focused models, but it can do both pretty well if you're skilled enough. <u>Check the examples!</u></p></li><li><p>Version 7 improves lora support, NSFW and realism. If you're interested in \"absolute\" realism, try <a target=\"_blank\" rel=\"ugc\" href=\"https://civitai.com/models/81458\">AbsoluteReality</a>.</p></li><li><p>Version 6 adds more lora support and more style in general. It should also be better at generating directly at 1024 height (but be careful with it). 6.x are all improvements.</p></li><li><p>Version 5 is the best at photorealism and has noise offset.</p></li><li><p>Version 4 is much better with anime (can do them with no LoRA) and booru tags. IT might be harder to control if you're used to caption style, so you might still want to use version 3.31.</p></li><li><p>V4 is also better with eyes at lower resolutions. Overall is like a \"fix\" of V3 and shouldn't be too much different.</p></li><li><p>Results of version 3.32 \"clip fix\" will vary from the examples (produced on 3.31, which I personally prefer).</p></li><li><p>I get no money from any generative service, but you can buy me a coffee.</p></li><li><p>You should use 3.32 for mixing, so the clip error doesn't spread.</p></li><li><p><strong>Inpainting models are only for inpaint and outpaint, not txt2img or mixing. </strong><br /></p></li></ul><p><strong>Original v1 description:</strong> <br />After a lot of tests I'm finally releasing my <s>mix</s> model. This started as a model to make good portraits that do not look like cg or photos with heavy filters, but more like actual paintings. The result is a model capable of doing portraits like I wanted, but also great backgrounds and anime-style characters. Below you can find some suggestions, including LoRA networks to make anime style images. <br /><br />I hope you'll enjoy it as much as I do.<br /></p><p>Official HF repository: <a target=\"_blank\" rel=\"ugc\" href=\"https://huggingface.co/Lykon/DreamShaper\">https://huggingface.co/Lykon/DreamShaper</a><br /></p>",
