        "name": "MeinaMix",
        "description": "<p><strong>MeinaMix objective </strong>is to be<strong> </strong>able to do good art with little prompting.<br /><span style=\"color:rgb(193, 194, 197)\">I have a </span><a target=\"_blank\" rel=\"ugc\" href=\"https://discord.gg/F6yeQtEQ98\">discord</a><span style=\"color:rgb(193, 194, 197)\"> where you can </span><strong>share images</strong><span style=\"color:rgb(193, 194, 197)\">, </span><strong>discuss prompt</strong><span style=\"color:rgb(193, 194, 197)\"> and </span><strong>ask for help</strong><span style=\"color:rgb(193, 194, 197)\">. </span><a target=\"_blank\" rel=\"ugc\" href=\"https://discord.gg/F6yeQtEQ98\">https://discord.gg/meinaverse</a><br /><span style=\"color:rgb(193, 194, 197)\">我有个可以让你分享图片和参与讨论与询问问题的discord群。</span><br /><br />I also have a <a target=\"_blank\" rel=\"ugc\" href=\"https://ko-fi.com/meina\"><strong>ko-fi</strong></a> and <a target=\"_blank\" rel=\"ugc\" href=\"https://www.patreon.com/MeinaMix\"><strong>Patreon</strong></a> page where you can support me or buy me a coffee &lt;3 , <strong>it will be very much appreciated:</strong><br /><a target=\"_blank\" rel=\"ugc\" href=\"https://ko-fi.com/meina\"><strong>https://ko-fi.com/meina</strong></a><strong> and </strong><a target=\"_blank\" rel=\"ugc\" href=\"https://www.patreon.com/MeinaMix\"><strong>https://www.patreon.com/MeinaMix</strong></a><br /><br /><strong>MeinaMix is officially hosted for online generation in:</strong><br />- <a target=\"_blank\" rel=\"ugc\" href=\"http://Sinkin.ai\">Sinkin.ai</a><br />- <a target=\"_blank\" rel=\"ugc\" href=\"http://Mage.space\">Mage.space</a> ( with animate feature )<br />- <a target=\"_blank\" rel=\"ugc\" href=\"https://tensor.art/models/596492342335111478\">Tensor</a><br />- <a target=\"_blank\" rel=\"ugc\" href=\"https://rendernet.ai/\">RenderNet</a><br />-<strong> </strong><a target=\"_blank\" rel=\"ugc\" href=\"https://www.seaart.ai/models/detail/3fae6b919ed209006e0a56248183fdff\">SeaArt</a><br /><br /><strong>MeinaMix and the other of Meinas will ALWAYS be FREE.</strong><br /><br /><strong>Recommendations of use:</strong><br />--------------------------------------------------------------------------------<br /><strong>Enable Quantization in K samplers.</strong><br /><br /><strong>Hires.fix is needed for prompts where the character is far away</strong> in order to make decent images, it drastically improve the quality of face and eyes!<br />---------------------------------------------<br /><strong>Recommended parameters:</strong><br /><strong>Sampler:</strong> DPM++ SDE Karras: 20 to 30 steps.<br /><strong>Sampler:</strong> DPM++ 2M Karras: 20 to 60 steps.<br /><strong>Sampler:</strong> Euler a: 40 to 60 steps.<br /><strong>CFG Scale:</strong> 4 to 11.<br /><strong>Resolutions:</strong> 512x768, 512x1024 for Portrait!<br /><strong>Resolutions: </strong>768x512, 1024x512, 1536x512 for Landscape!<br /><strong>Hires.fix:</strong> R-ESRGAN 4x+Anime6b, with 10 steps at 0.3 up to 0.6 denoising.<br /><strong>Clip Skip:</strong> 2.<br /><strong>Negatives:</strong> ' (worst quality, low quality:1.4), (zombie, sketch, interlocked fingers, comic) '<br /><strong>Negatives if you can't use Hires.fix:</strong><br />'(worst quality:1.6, low quality:1.6), (zombie, sketch, interlocked fingers, comic)'<br />--------------------------------------------------------------------------------<br /><br /><strong>In the merged models list: MeinaMix V1~9, MeinaPastel V3~6, MeinaHentai V2~4, Night Sky YOZORA Style Model, PastelMix, Facebomb, MeinaAlterV3 </strong>i do not have the exact recipe because i did multiple mixings using block weighted merges with multiple settings and kept the better version of each merge.</p>",
