        "id": 7371,
        "name": "ReV Animated",
        "description": "<p><em>April 28, 2024: added V2 Rebirth pruned</em></p><h1 id=\"heading-46\"><span style=\"color:rgb(64, 192, 87)\">v2:REBIRTH</span></h1><p><span style=\"color:rgb(230, 73, 128)\">Thanks to </span><span style=\"color:rgb(250, 82, 82)\">S6yx</span><span style=\"color:rgb(230, 73, 128)\"> for the creation of this beautiful model. Enjoyed by millions. With their permission, I, </span><span style=\"color:rgb(250, 82, 82)\">Zovya</span><span style=\"color:rgb(230, 73, 128)\">, will be maintaining it moving forward.</span></p><p></p><p><em>April 4, 2024: fp16 and +VAE added</em></p><p><em>April 2, 2024: Rebirth</em></p><p><em>Update 3: Disclaimer/Permissions updated</em></p><p><em>Update 2: I am no longer maintaining/updating this model</em></p><p><em>Update 1: I've been a bit burnt out on SD model development (SD in general tbh) and that is the reason there have not been an update. Looking to come back around and develop again by next month or so.Thank you everyone who sends reviews and enjoy my model</em><br /></p><p><strong>Pay attention to the <em><u>About this version</u></em></strong> <strong>section </strong>of model page<strong> for specific version information. ➡️➡️➡️➡️➡️</strong></p><h3 id=\"heading-416\"><br /><u>Model Overview:</u></h3><ul><li><p><u>rev</u> or <u>revision</u>: The concept of how the model generates images is likely to change as I see fit.</p></li><li><p><u>Animated</u>: The model has the ability to create 2.5D like image generations. This model is a checkpoint merge, meaning it is a product of other models to create a product that derives from the originals.</p></li><li><p>Kind of generations:</p><ul><li><p>Fantasy</p></li><li><p>Anime</p></li><li><p>semi-realistic</p></li><li><p><em>decent Landscape</em></p></li></ul></li><li><p>LoRA friendly</p></li><li><p>It works <strong><em><u>best on these resolution dimensions:</u></em></strong></p><ul><li><p>512x512</p></li><li><p>512x768</p></li><li><p>768x512</p></li></ul></li></ul><p></p><h3 id=\"heading-417\"><u>VAE</u>:</h3><ul><li><p><a target=\"_blank\" rel=\"ugc\" href=\"https://huggingface.co/WarriorMama777/OrangeMixs/blob/main/VAEs/orangemix.vae.pt\"><u>orangemix.vae.pt</u></a></p></li><li><p><a target=\"_blank\" rel=\"ugc\" href=\"https://huggingface.co/hakurei/waifu-diffusion-v1-4/tree/main/vae\">kl-f8-anime2.ckpt</a></p></li><li><p><a target=\"_blank\" rel=\"ugc\" href=\"https://huggingface.co/NoCrypt/blessed_vae/blob/main/blessed2.vae.pt\">Blessed2.vae.pt</a></p><p><br /></p></li></ul><h3 id=\"heading-418\"><u>Prompting</u>:</h3><ul><li><p><strong>Order matters</strong> - words near the front of your prompt are weighted more heavily than the things in the back of your prompt.</p></li><li><p><strong>Prompt order</strong> - content type &gt; description &gt; style &gt; composition</p></li><li><p><strong>This model likes</strong>: ((best quality)), ((masterpiece)), (detailed) in beginning of prompt if you want anime-2.5D type</p></li><li><p>This model does great on<strong> <u>PORTRAITS</u></strong></p></li></ul><p></p><p><strong><u>Negative Prompt Embeddings:</u></strong></p><ul><li><p><a target=\"_blank\" rel=\"ugc\" href=\"https://huggingface.co/embed/EasyNegative/tree/main\">EasyNegative</a></p></li><li><p><a target=\"_blank\" rel=\"ugc\" href=\"https://civitai.com/models/4629/deep-negative-v1x\">Deep Negative</a></p></li><li><p><a target=\"_blank\" rel=\"ugc\" href=\"https://huggingface.co/embed/bad_prompt/blob/main/bad_prompt_version2.pt\">bad_prompt_version2</a></p></li><li><p><a target=\"_blank\" rel=\"ugc\" href=\"https://huggingface.co/nick-x-hacker/bad-artist/blob/main/bad-artist.pt\">bad-artist</a></p></li><li><p><a target=\"_blank\" rel=\"ugc\" href=\"https://huggingface.co/nick-x-hacker/bad-artist/blob/main/bad-artist-anime.pt\">bad-artist-anime</a></p></li><li><p><a target=\"_blank\" rel=\"ugc\" href=\"https://huggingface.co/p1atdev/badquality/tree/main\">bad-quality</a></p></li><li><p>Make use of weights in negative prompts (i.e (worst quality, low quality:1.4))</p><p></p></li></ul><p></p><h3 id=\"heading-419\"><u>Video Features</u></h3><p></p><p><a target=\"_blank\" rel=\"ugc\" href=\"https://youtu.be/Nl43zR5dVuM?t=192\">Olivio Sarikas - Why Is EVERYONE Using This Model?! - Rev Animated for Stable Diffusion / A1111</a></p><p></p><p><a target=\"_blank\" rel=\"ugc\" href=\"https://www.youtube.com/watch?v=A6dQPMy_tHY\">Olivio Sarikas - ULTRA SHARP Upscale! - Don't miss this Method!!! / A1111 - NEW Model</a><br /><br /><a target=\"_blank\" rel=\"ugc\" href=\"https://www.youtube.com/watch?v=ezNDCWhv4pQ\">AMAZING SD Models - And how to get the MOST out of them!</a></p><p></p><p></p><h2 id=\"heading-420\"><strong><u>Disclaimer (Updated 10/31/2023):</u></strong><br /></h2><p>The license type is <a target=\"_blank\" rel=\"ugc\" href=\"https://creativecommons.org/licenses/by-nc-nd/4.0\">CC BY-NC-ND 4.0</a> <br /><strong>Do not sell</strong> this model on any website without permissions from creator (me)</p><p><strong>Credit</strong> me if you use my model in your own merges</p><p><strong><u>You can use derivative models which uses ReV Animated for Buzz points and site-based currency that does not convert over to real world currency.</u></strong></p><p>Do not use this model to <strong><u>monetize</u></strong> on other platforms without expressed written consent. <br /><br /></p>",
