        "id": 6755,
        "name": "Cetus-Mix",
        "description": "<p><strong>NOTICE</strong>:<strong>LET ME KNOW</strong> before you put this model on <u>commercial usage</u>.</p><p>My twitter account:<strong>@eagelaxis </strong>:) Contact me if needed.</p><p>Discord Account:<strong>Eagelaxis#7818</strong></p><p><strong>Version Choosing Advice</strong>:<strong>V2f,V3,Coda and V3.5</strong> are recommended,especially <strong>CODA</strong> for first-time users.</p><p>Hard to tell how many models used to merge.</p><p>Check the example images to recognize this model's art style</p><p>For more example images, just take a look at <a target=\"_blank\" rel=\"ugc\" href=\"https://pixai.art\">https://pixai.art</a></p><p>More attention on shades and backgrounds compared with former models(<a target=\"_blank\" rel=\"ugc\" href=\"https://civitai.com/models/6408/andromeda-mix\">Andromeda-Mix | Stable Diffusion Checkpoint | Civitai)</a></p><p>Hands-fix is still waiting to be improved.</p><p>Highres-fix(upscaler) is strongly recommended(using the SwinIR_4x,R-ESRGAN 4x+anime6B by myself) in order to not make blurry images.</p><p>(Sorry for the misunderstanding caused by myself.\"Bad_prompt_v2:1.4\" is a kind of embedding recognized as collection of normal negative prompts such as\"lowres,bad anatomy\".)</p><p>Recommend: Clip skip 2 Sampler:DPM++2M Karras Steps:20+</p><p>CFG scale:4-8 Vae:<a target=\"_blank\" rel=\"ugc\" href=\"http://Pastel-Waifu-Diffusion.vae.pt\">Pastel-Waifu-Diffusion.vae.pt</a>(The vae used by Pastel-mix si just good enough)</p><p>Highres.fix:SwinIR_4x Hires steps:10+ Denoising strength:0.4+ Upscale by: 1.5+</p><p>Loras along with embeddings on hands-fix are strongly recommended.</p><p>V4.5 should be coming soon.</p><p>Looking forward to your reviews!</p>",
