            "description": "<p>A late update of WhaleFall series.</p><p>Mainly focused on more flat anime styles compared with CODA.</p><p>(Actually you can see whalefall as a branch of Version3,while Coda with Version3.5.)</p><p>Changed shades and lighting to make the whole background kinda like oil painting texture.</p><p>Maybe not suitable for some loras.</p><p>Would be nice if  you could share either your generated art or some advice :)</p><p>(Lack of inspiration these days.)</p><p>Some little compliants (u don't have to translate this):</p><p>之前有不少国内的朋友想让我把模型传到诸如liblibai、吐司之类的国内网站上，说实话一开始是有这个想法的，但是后面一看到那堆霸王条款 想想还是算了。不要求你跟小破C站一样尊重作者，但是转载的话起码得问下我吧。也没必要拿什么“想分钱了”“训练素材违法”之类的绑架哥们儿，到现在为止我没通过上传模型挣过一分钱，我也只是个平平无奇的融模狱友而已。</p><p>国内的小伙伴可以在novelai贴吧里面找到我（虽然一万年没回过消息了）</p>",
