            "description": "<p>v3.0版本说明：</p><p>1.很高兴向大家介绍XXMix_9系列的3.0版本。这个版本在泛用性和对LORA的支持上都有明显的加强，并且手部的表现要明显好于之前的版本。3.0版本是由v2.5、v2.6和XXMix_4这三个版本Mix而来。生成的图片我尽量不用任何Embedding模型，因为我发现有些Embedding模型比较隐晦，你不知道哪些Embedding模型起了作用哪些没起作用，从而不能还原图例。</p><p>2.如果你想还原图例，请先安装以下扩展：</p><p><a rel=\"ugc\" href=\"https://github.com/Bing-su/adetailer\">adetailer</a>:建议在生成图片时始终开启（如果你想90%以上还原图例，那么建议你在图片信息内查看adetailer是否已开启）。</p><p><a rel=\"ugc\" href=\"https://github.com/mcmonkeyprojects/sd-dynamic-thresholding\">CFG Scale Fix</a>:有需求的时候开启，会提高画面的质感。我用的默认数值7左右，如果是白天CFG数值可以稍微大一些，晚上数值要小一些。</p><p>（经过我的测试，在第二台电脑上没有办法100%还原图例，我现在还不知道是什么原因，有可能是CFG Scale Fix这个扩展的问题，也有可能是分块VAE的问题，不过基本上你可以还原到90%-95%左右，对画面的影响不是很大。）</p><p>3.对于生成图片，个人的小心得：如果你得到了一张非常喜欢的图片，但是手部或其他部位的问题很严重，如果你不想用局部重绘修改的话，那么建议你在固定好seed之后，微调CFG的数值（每次调整0.2-0.3这种幅度来尝试），这样你就有可能在保持原图的基础上得到一张完美的图片。</p><p>4.在这里，我还想分享一个我喜欢的后缀句子，它可以让画面的表现力更强。当然，你可以根据需要修改句子中的单词来微调画面风格。这些单词包括：,fantasy, high contrast, ink strokes, explosions, over exposure, purple and red tone impression , abstract, ((watercolor painting by John Berkey and Jeremy Mann )) brush strokes, negative space,</p><p>5.最后，如果你喜欢这次模型的更新，希望你可以把生成的好看图片分享出来。</p><p>Version 3.0 Description:</p><p>Pleased to introduce the 3.0 version of the XXMix_9 series. This version has significantly improved in versatility and support for LORA, and the hand performance is significantly better than the previous versions. The 3.0 version is a mix of v2.5, v2.6, and XXMix_4. When generating images, I try not to use any Embedding models as much as possible because I have found that some Embedding models are more obscure, and you don't know which ones are working and which ones are not, which makes it difficult to restore the example.</p><p>If you want to restore the example, please install the following extensions first:</p><p>Adetailer (<a target=\"_blank\" rel=\"ugc\" href=\"https://github.com/Bing-su/adetailer\">https://github.com/Bing-su/adetailer</a>): It is recommended to always enable it when generating images. If you want to restore the example by more than 90%, it is recommended to check whether Adetailer is enabled in the image information.</p><p>CFG Scale Fix (<a target=\"_blank\" rel=\"ugc\" href=\"https://github.com/mcmonkeyprojects/sd-dynamic-thresholding\">https://github.com/mcmonkeyprojects/sd-dynamic-thresholding</a>): Enable it when needed, it will improve the quality of the image. I use the default value of about 7. If it is daytime, the CFG value can be slightly larger, and at night, the value should be smaller. (After my test, I cannot restore the example 100% on the second computer. I still don't know the reason. It may be a problem with the CFG Scale Fix extension or the block VAE. However, you can basically restore it to about 90%-95%, and the impact on the image is not significant.)</p><p>For generating images, here is my personal experience: If you get a picture that you really like, but there are serious problems with the hands or other parts, and you don't want to use local redraw to modify it, then it is recommended to adjust the CFG value slightly (0.2-0.3 range) after fixing the seed. This way, you may get a perfect picture while keeping the original image.</p><p>Here, I would like to share a suffix sentence that I like, which can make the image more expressive. Of course, you can modify the words in the sentence to fine-tune the image style. These words include: fantasy, high contrast, ink strokes, explosions, overexposure, purple and red tone impression, abstract, brush strokes ((watercolor painting by John Berkey and Jeremy Mann)), negative space.</p>",
